                "description": "<p>Cream is a <a href=\"https://www.leafly.com/strains/lists/category/hybrid\" rel=\"noopener noreferrer\" target=\"_blank\">hybrid</a> weed strain made from a genetic cross between <a href=\"https://www.leafly.com/strains/wedding-cake\" rel=\"noopener noreferrer\" target=\"_blank\">Wedding Cake</a> and <a href=\"https://www.leafly.com/strains/gelato-33\" rel=\"noopener noreferrer\" target=\"_blank\">Gelato #33</a>. Cream is 14% THC, making this strain an ideal choice for beginner cannabis consumers. Leafly customers tell us Cream effects include feeling <a href=\"https://www.leafly.com/strains/lists/effect/focused\" rel=\"noopener noreferrer\" target=\"_blank\">focused</a>,&nbsp; <a href=\"https://www.leafly.com/strains/lists/effect/aroused\" rel=\"noopener noreferrer\" target=\"_blank\">aroused</a>, and <a href=\"https://www.leafly.com/strains/lists/effect/tingly\" rel=\"noopener noreferrer\" target=\"_blank\">tingly</a>. Medical marijuana patients often choose Cream when dealing with symptoms associated with <a href=\"https://www.leafly.com/strains/lists/condition/muscle-spasms\" rel=\"noopener noreferrer\" target=\"_blank\">muscle spasms</a>, <a href=\"https://www.leafly.com/strains/lists/condition/pain\" rel=\"noopener noreferrer\" target=\"_blank\">pain</a>, and <a href=\"https://www.leafly.com/strains/lists/condition/depression\" rel=\"noopener noreferrer\" target=\"_blank\">depression</a>. Bred by Cream Crop Co, Cream features flavors like <a href=\"https://www.leafly.com/strains/lists/flavor/flowery\" rel=\"noopener noreferrer\" target=\"_blank\">flowery</a>, <a href=\"https://www.leafly.com/strains/lists/flavor/berry\" rel=\"noopener noreferrer\" target=\"_blank\">berry</a>, and <a href=\"https://www.leafly.com/strains/lists/flavor/pungent\" rel=\"noopener noreferrer\" target=\"_blank\">pungent</a>. The dominant terpene of this strain is <a href=\"https://www.leafly.com/strains/lists/terpene/myrcene\" rel=\"noopener noreferrer\" target=\"_blank\">Myrcene</a>. The average price of Cream typically ranges from $30-$40. If you’ve smoked, dabbed, or consumed Cream, tell us about your experience by leaving a strain review.</p>",
